import classNames from 'classnames';
import types from 'prop-types';
import React from 'react';
import Button from '../../../../../../components/Button';
import { SectionTitle } from '../../../../../../components/SectionTitle';

// Styles

import './styles.scss';

// ----------------

const data = {
    adress: '91 Nolan Extensions Suite 670',
    phone: '+001 356-868-2454',
    email: 'gahuy93@gmail.com',
    timetable: 'From 07:05AM to 19:30PM',
};

export const ContactsCard = (data) => {
    return (
        <div className="contacts-card">
            <SectionTitle
                className="contacts__title"
                fluidWidth
                color="secondary"
                title="Get In Touch"
            />
            <div className="contacts">
                <div>{data.adress}</div>
                <div>{}</div>
                <div></div>
                <div></div>
            </div>
            <Button withBorder borderColor smallSize>
                Submit
            </Button>
        </div>
    );
};

// ----------------

// Type of props

ContactsCard.propTypes = {
    prop: types.string,
};

// Default value for props

ContactsCard.defaultProps = {};
